import React from "react";

const Total = (props) => {
  const parts = props.course.parts;
  console.log(props);
  return (
    <div>
      <p>
        Number of exercises{" "}
        {parts.reduce((acc, sum) => {
          {
            exercises: acc.exercises + sum.exercises;
          }
        })}
        {parts[0].exercises + parts[1].exercises + parts[2].exercises}
      </p>
    </div>
  );
};

export default Total;
